description:
Summer's been walking the streets in front of the truck stop all day long trying to find a horny guy. What a surprise when a passionate artist walks up and invites her back to his loft to make his own kind of &quot;art&quot;. When they get back to his studio, he paints a stunning portrait of Summer's curvalicious body, and charms the pants off of her with his remarkable skills.

